import React from 'react';
import * as obj from './Mathcalc';


function App() {
    
    return (<>
        <p> Sum of Two Nos is {obj.add(2, 3)}</p>
        <p>Subtraction of Two Nos is { obj.sub(8,5)}</p>
        </>)
        ;
}

export default App;
